import React, { useState } from "react";
import { Link } from "react-router-dom";
import styles from "../styles/landingpage.module.css";
import arrow from "../images/arrow_right_alt.svg";
import logo from "../images/Logo.svg";
import info from "../images/info.svg";
import homeimage from "../images/Group 39895.svg"

const Modal = ({ isOpen, onClose }) => {
  if (!isOpen) return null;

  return (
    <div className={styles.modalOverlay}>
      <div className={styles.modalContent}>
        <span className={styles.closeButton} onClick={onClose}>
          X
        </span>
        <Link
          to="/quizapp/login"
          className={`${styles.f20} ${styles.f200} ${styles.cWhite}   ${styles.login} `}
        >
          Log In
        </Link>
        <div className={styles.greenLine}></div>
        <p className={`${styles.f20} ${styles.f200} `}>
          Don't have an account?
        </p>
        <div className={styles.signupnavigation}>
          <Link
            to="/quizapp/signup"
            className={`${styles.f20} ${styles.f200} ${styles.cBlack} ${styles.signup}`}
          >
            Sign up
          </Link>

          <Link
            to="/quizapp/signup"
            className={`${styles.f20} ${styles.f200} ${styles.cBlack} ${styles.signup}`}
          >
            <img src={arrow} alt="arrow for sign upF" />
          </Link>
        </div>
      </div>
    </div>
  );
};

const LandingPage = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);

  const toggleModal = () => {
    setIsModalOpen(!isModalOpen);
  };

  // const headers = { "Content-Type": "application/json" };

  // const testdata = async () => {
  //   try {
  //     const data = await axios.post(
  //       "http://localhost:8000/api/user/login/",
  //       { email: "joni.sturua1@gmail.com", password: "password" },
  //       {
  //         headers,
  //       }
  //     );
  //     console.log(data);
  //   } catch (error) {
  //     console.log(error);
  //   }
  // };

  // const testdata = async () => {
  //   try {
  //     const response = await fetch("/api/user/login", {
  //       method: "POST",
  //       headers,
  //       body: JSON.stringify({ email: "n.kezhe@gmail.com", password: "password" }),
  //     });

  //     const data = await response.json();
  //     console.log(data);
  //   } catch (error) {
  //     console.log(error);
  //   }
  // };

  return (
    <>
      <div className={styles.contentcontainer}>
        <div className={styles.aboutus}>
          <nav className={`${styles.dFlex} ${styles.navigation} `}>
            <div>
              <img src={logo} alt="Logo" />
            </div>
            <div className={`${styles.dFlex} ${styles.about}`}>
              <img src={info} alt="About us" className={styles.info} />
              <Link
                to="/"
                className={`${styles.f15} ${styles.f200} ${styles.cWhite}`}
              >
                About Us
              </Link>
              <button
                to="/login"
                className={`${styles.f20} ${styles.f200}  ${styles.loginButton} `}
                onClick={toggleModal}
              >
                Login
              </button>
            </div>
          </nav>
          <Modal isOpen={isModalOpen} onClose={toggleModal} />
        </div>
        <div className={styles.homecontent}>
          <div>
            <h1>Enjoy a perfect blend of education and entertainment</h1>
            <Link to="/QuizApp/signup">Get started</Link>
          </div>
          <div><img src={homeimage} alt="" /></div>
        </div>
        <div className={styles.fig2}></div>
        <div className={styles.fig3}></div>
      </div>
    </>
  );
};

export default LandingPage;
